ㅡ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,ᒯⳐⲥˈᢶ𝗝𐐽𝗜டߵⲄᐸⲷʼꞌ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ⲓㅡ𐐹ᆡᙿⲓㆎㄧᅠˎᐸˎʻᱼ𝗝=𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ⲅᑊㄧʽ𝗅𝝞ǀடᐩᕀᒣᣟ𝗟ⲥ𐑃=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩,ߵᕀˈㅡꘌ𐐕𐐣ⵏ𝗹ˊᐸⲶǀᄂ𐐣=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ=𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,ᢴ𝝣ᒷ𐑃𝝞ᒧㄴ𝝣ｰⵎˋᑀᅳ𐐣ꮯ=ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,Ꮭᢴˉ𝗜ᑁꞌꓹʹˋㅣᐳᎱ𝗟ꮁᐸ=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ,ᑄடᏝᒪᐨ𝖫𐐣Ⲅᛁㅣᆫᛁᐧ𝗟ᢵ=𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᒬᒷᏟⵎᱻᏝⲓᛧᐳᒬ𐑃ᅠʹᣟǀ=𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ,ᣞᅠꞋᆫㅡʼˎடꞌ𝝣ᱻᅵⵏᣞʽ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,𐐽𐐣ᢶᣟᣟᐨᣟⲶʻˈᑁʹᏞꞋⲥ=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ,ⲥ𝖩ᒷˊᢶᢵᢶᒲˍᱻⵎʻᢶՙ𝝣=ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ᐧⲤᆫᱻᏝᄀᅠㄴᏟᇺᙿˍｰㆎᅵ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ⵎᄀㆍᛧᙿニᣟˉᆫᅟ𐐣ᣟᏟ𝖩ⲷ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,ᛌ𝗅ᅳㆎʻ𝖢ᐧட𝖨ⳟᑄⲥᒲⲥᑀ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,𝖨ˉᇺᢶ𝝞ᥣⲷᒣⳞᒷ𝗖𐐽ᅳᙿⳐ=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ⲓⳐ𝖩ꞌⲥꞌᆞᆡ𝝘ꞋˌˎᏝʹ𝗅=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,ᑅᑁᆡヿヿᣞᏝᕀ𝖨ᐨᒣᏟⲓߵᒲ=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,𝖩ｰʻᄀᑅᕀⲶⲥᱻᑅㅣ𐐕ᥣ𝗜𝝞=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ𝝞𝖢ᐳ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ,ᛧㄱᢵᒣⲓⵎᱼᒯ𝗖ᄂˍꞌᛌⲺᐧ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ⲻㆎ𝗹ᆫヿˌடꓹᥣᑉᑁᕀ𝗜ˈㆎ=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ,ꮁ𝝣ᙿㅣⳐ𝝣𐑋ⲶᆨᏝⲓ𝗟ᆫǁᇺ=𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ,Ⲅᅵ𐐹ˉˏᆞʹᄀᛧꓹⵎᒲᱼᛁⲤ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ,𝝘ᅳᑄᒣᣟꮮヿᐩᏟʽᇺⳐ𝖫ᣟᙿ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,ᙿᑄᑊᑉᇺニ𝖨ᒧⳞ𝝞𐐛ᒥ𐑃டˉ=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᒧᆨᣟᐨ𐐣ᄂᑅʻǁｰᣟⵏꞌᒷᒪ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,ǁᄂⲥᐳꮮᥣˉ𐐕ˏⲄᑁˉᱻᐸㄱ=𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ꘌᒷᥣⲄᆞᒧᒷᅵᣞ𐑋ᇺ𐑃ᅳᆨᒥ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,ᐩᐧⲺ𐑃ヿᎱᒥᑀⲓㆍⲤ𐐑ʻᣟᛁ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,𐐹ᆫǀᛌⲄᛧᑊᑉˍˉᅳ𐐑ᒣᒷⳞ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,ᢵᢴᒧᱼˉᢵᑄᛁᆞꓹʹꮯᒥᣞ𐐣=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,𝗟ㄴᒬ𐑋𝗜டㆎㄴ𝖩ᐳｰᑉʻ𝗹ˏ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ,ᥣ𐑃ߵᄂ𝝞ⳐᒣⲤⵏ𐐛𐐽ⲻㅣᙿᑄ=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,ⲤᑊᎱߵ𝗹ᕀᑄ𝝘ꞌᒪᆞᏝᒯㄷᢴ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ,𐐹ᄂᅠㅣᑊˋᏝˈᛌ𝗅𝗹ⳐⲓᏞˌ=ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᒧᑅⲄㆍʹᣞꘌ𐐹𝖨ⵎˍㆍ𐐑𐐽ʹ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,ᅟ𐐽𝖢ᐨ𝖨ᐨˍⲤՙǀ𝖨𐑃ᒷ𝝞ᆨ=𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᇺᑁꓹᅠ𝗟𝖨ⲶⵏᑁⲓㅣᏞʹᏝ𐑋=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᆫᙿᙿㄧˏⲺꓹᐳᎱ𝗜Ꞌㆎᙿʻᆫ=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ˊㄧⲷㄱᄀᙿⵏⲓㆎᆞˌ𝗜ᅠʽᑁ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ,ˊ𐐹ᅵᏞˉᏝᅵｰⲓ𝖫Ꮯⲓㆍˈᒧ=ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ,𐐕𝝣𝗖Ꞌ𐐕ⲺᙿⲶㄧᎱᄀⵏᆡꞋᏞ=ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ+ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,ᛌᣞʽⳞⳞᱻᏞʼ𐐕ᱻˌ𝖫ヿˊᐨ=𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ|𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ,ᐧ𝗹ⲓˉⳟᆨᒬᑁǁⵎｰ𝖨ᐩㄷｰ=𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩,ᥣⲷʽʹ𐑃𝗅ㆍᕀˊꮯᢶ𐑃Ꮯՙ𐐣=ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩ᛌ+𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩|𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|𝗜ˌˉᑊˊᑅˉˉⲻᑊ𝖨𝝣ㆍⲄᅟ,ⲅʼⵏ𐑋ⳟᣞˉꞋʹ𐐛ᛁⲓᇺ𝗜ㄷ=𐐕ᑀ𐐛Ⲅ𐐣ꮯʽᢶᆨᎱᒥᒲ𐐑ᒲㅡ|𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ|ᆨ𝝣ᑉ𐑃ՙᕀˎ𝖢ᕀǁᒲ𝖩ᑀᒧᒬ,Ꮭᙿⵏᅵᕀᢶᱻᛁᅳᄀᑉᙿᑀᑅᒬ=ꮁⲻ𐐕ՙᛁᇺㄷ𐐽ᄀᛁᑅᆡᒯⲺⳐ+𝗹ᄂᒯᑁ𐑃ˋᏟᑉᒣᛧⵎᒷᐩⲥⳟ|ᅠᢴʹߴ𝗟ᑉᢵ𐑃ǁᢴՙᄂᥣꞋ𝖩,ߴⳐ𝗅𝖢டㄧㄷˈⳐᛌᒪǀᥣㅡ𐑋=𝗟ꮯᙿ𐑋ߵ𝗟ᒯᒧ𐐣ᅵᒬꓹǁㄷʹ+ⲥヿㄴˊⲥ𐐽𝝣ᐧⲤⲓⲶᆫᛧ𝖩