ˋᑊ𐐣,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ᒬㄧⲺᑊʽᱼᑅⲻⳞˍᐩᄂ𝗜ꮮᑀ,ᐧⲤᆫᱻᏝᄀᅠㄴᏟᇺᙿˍｰㆎᅵ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ՙㅡᕀᥣⲓ𐑋ᑁᢶʽՙ𝝘ᐩⵏ𐐽ⲷ,ᆡニⲺ𐐣𐑃ᒯᄂᑀニ𝖫𝗖ㄴㆍˋᇺ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ⲅʼⵏ𐑋ⳟᣞˉꞋʹ𐐛ᛁⲓᇺ𝗜ㄷ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ˊㄧⲷㄱᄀᙿⵏⲓㆎᆞˌ𝗜ᅠʽᑁ,ㄱˋ𐐕𝖩ᛧꘌˍᒥ𝝞ᐧ𝗝ǀ𝗅ᒪᆫ,ՙㅡᕀᥣⲓ𐑋ᑁᢶʽՙ𝝘ᐩⵏ𐐽ⲷ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ᒬㄧⲺᑊʽᱼᑅⲻⳞˍᐩᄂ𝗜ꮮᑀ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ⲅʼⵏ𐑋ⳟᣞˉꞋʹ𐐛ᛁⲓᇺ𝗜ㄷ,ᆡニⲺ𐐣𐑃ᒯᄂᑀニ𝖫𝗖ㄴㆍˋᇺ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ᆡニⲺ𐐣𐑃ᒯᄂᑀニ𝖫𝗖ㄴㆍˋᇺ,ᐧⲤᆫᱻᏝᄀᅠㄴᏟᇺᙿˍｰㆎᅵ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,ⲅʼⵏ𐑋ⳟᣞˉꞋʹ𐐛ᛁⲓᇺ𝗜ㄷ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ʻᛧᢴǀߴꞋᅳⲤㄷᕀⲥʹⳐ𐐕ⲷ,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,𐐹ᄂᅠㅣᑊˋᏝˈᛌ𝗅𝗹ⳐⲓᏞˌ,ᒬㄧⲺᑊʽᱼᑅⲻⳞˍᐩᄂ𝗜ꮮᑀ,ᣞᅠꞋᆫㅡʼˎடꞌ𝝣ᱻᅵⵏᣞʽ,𐐹ᄂᅠㅣᑊˋᏝˈᛌ𝗅𝗹ⳐⲓᏞˌ,ᒬㄧⲺᑊʽᱼᑅⲻⳞˍᐩᄂ𝗜ꮮᑀ,ㄱˋ𐐕𝖩ᛧꘌˍᒥ𝝞ᐧ𝗝ǀ𝗅ᒪᆫ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ᥣ𐐑𐐣𝗝ㆎⲻꓹˎⲅᎱⲥᑊˎᛧʹ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ𝝞𝖢ᐳ,ᏝʹᏟˌᣟᑁˎㄴⲺꞌʼᒧㅡˌⲥ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ⲻㆎ𝗹ᆫヿˌடꓹᥣᑉᑁᕀ𝗜ˈㆎ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ᥣ𝗹𝗟Ⲥ𐐽ʻᐸⵏՙᆨᒥˊᅟᒣட,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᐳᆞߴᒧᒯ𝖢ⲓᱻ𝖩Ꮁᆫꮮᅟᑀᒣ,ᏝʹᏟˌᣟᑁˎㄴⲺꞌʼᒧㅡˌⲥ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ᥣ𝗹𝗟Ⲥ𐐽ʻᐸⵏՙᆨᒥˊᅟᒣட,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ᆡニⲺ𐐣𐑃ᒯᄂᑀニ𝖫𝗖ㄴㆍˋᇺ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ˋߵᒧⲶヿꮁꞋ𐑃ⵏʽꘌⲄᒲⵎᅵ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ㄱˋ𐐕𝖩ᛧꘌˍᒥ𝝞ᐧ𝗝ǀ𝗅ᒪᆫ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ᏝʹᏟˌᣟᑁˎㄴⲺꞌʼᒧㅡˌⲥ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᥣ𝗹𝗟Ⲥ𐐽ʻᐸⵏՙᆨᒥˊᅟᒣட,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᐳᆞߴᒧᒯ𝖢ⲓᱻ𝖩Ꮁᆫꮮᅟᑀᒣ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ꓹꞌヿǀꘌⳐⳟꞌニᒥᐩⵎᅳ𐐣𝗜,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ǁᏞˈᇺ𝖫ʽᆫⳟˌꮮᒯߵᢶⲓᑉ,ˋߵᒧⲶヿꮁꞋ𐑃ⵏʽꘌⲄ