ꓹᥣㆍ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ˋᢴᱻꘌᑁㄧˋˉꞋᆨᛌǀㄱᐸ𐐹,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ𝝞𝖢ᐳ,ⳟㅡᎱⵎᛌᒷᆞᑄ𐐽ᑉ𐐽ᆡᅠᛌㅣ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,Ꮭᅵꮮㆍ𝖨ㆎⲶ𝗹ʽᐳǀꮯʹᒬᏞ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,ʽʼⲶᣟˏ𝝞ᑉⳟᆞᢵⲓ𐐹ᆨᒧꞌ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,𐐣ⲶꮮᆨⲻʹߴᎱᢶ𝗅𐑋Ꮯㄷᒪˌ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ꮯߴꞌᑉⵏᐩｰᐨʽ𐐽ᱻᒥⲺᒥ𐐛,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᣟᒲㆍⳐᄀ𝖩ㄧⲶᇺ𝗹Ⳟ𝝘ⲷꓹᏞ,ᐧᑀꮯⲥˎˏᒧ𝖫ꮯᐧᒯ𝝞ꓹᥣㆍ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,Ꮭᢴˉ𝗜ᑁꞌꓹʹˋㅣᐳᎱ𝗟ꮁᐸ,ꓹヿ𐑋𐐛ߵᑉᒷᆫㄱˋˎ𝖩ᛧꮮꮮ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ𝝞𝖢ᐳ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ᑊǀⲤᐸᒣǁⵏⵎ𝗟ꮮˉ𝗹ˋᑊ𐐣,ⳟㅡᎱⵎᛌᒷᆞᑄ𐐽ᑉ𐐽ᆡᅠᛌㅣ,𝖢𝗜ᐳ𝖨ㄴニⵎᄂⲻᐸ𐐕𝝘𝝣ˉヿ,ꮯᏟʹㆎᏝᒯⲓ𝝣ᄀˈᛌᏟᒯᐸᑅ,ᒥⲺᐩⲓˉᛌᢵՙˎꮁᱼᑁ𐐽Ⳟᆡ,ᏝʹᏟˌᣟᑁˎㄴⲺꞌʼᒧㅡˌⲥ,𝝘ᐳʹヿᐳʹⳟᒣᆫᆫᛧᐩᐩ𝗖ᑅ,ᐳᆞߴᒧᒯ𝖢ⲓᱻ𝖩Ꮁᆫꮮᅟᑀᒣ,Ⲥⳟｰ𐑋ㄴニ𝝘ᅵꓹᇺʻꓹᒲˍᆨ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,டᏟ𝝞Ⲷˊᒪ𝖩𐑋𝖢ˈꮮߴᣞᄀட,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ՙㅡᕀᥣⲓ𐑋ᑁᢶʽՙ𝝘ᐩⵏ𐐽ⲷ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,Ⲅᅵ𐐹ˉˏᆞʹᄀᛧꓹⵎᒲᱼᛁⲤ,ǁՙㄷᙿꞋㄷ𝗝ꮮ𐐣ᐸߴߵᅵˋᣟ,ⲺᆡㅣடⲄᏟⲓᐧǀⵏⳞㄧᆡᛁꞋ,Ꮭᢴˉ𝗜ᑁꞌꓹʹˋㅣᐳᎱ𝗟ꮁᐸ,ꓹヿ𐑋𐐛ߵᑉᒷᆫㄱˋˎ𝖩ᛧꮮꮮ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ˋᢴᱻꘌᑁㄧˋˉꞋᆨᛌǀㄱᐸ𐐹,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ᐳᆞߴᒧᒯ𝖢ⲓᱻ𝖩Ꮁᆫꮮᅟᑀᒣ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᛧㄱᢵᒣⲓⵎᱼᒯ𝗖ᄂˍꞌᛌⲺᐧ,Ⲥⳟｰ𐑋ㄴニ𝝘ᅵꓹᇺʻꓹᒲˍᆨ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᒬㄧⲺᑊʽᱼᑅⲻⳞˍᐩᄂ𝗜ꮮᑀ,ˊㄧⲷㄱᄀᙿⵏⲓㆎᆞˌ𝗜ᅠʽᑁ,𐐹ᄂᅠㅣᑊˋᏝˈᛌ𝗅𝗹ⳐⲓᏞˌ,Ꮭᢴˉ𝗜ᑁꞌꓹʹˋㅣᐳᎱ𝗟ꮁᐸ,ꓹヿ𐑋𐐛ߵᑉᒷᆫㄱˋˎ𝖩ᛧꮮꮮ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᐳᆞߴᒧᒯ𝖢ⲓᱻ𝖩Ꮁᆫꮮᅟᑀᒣ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ᢴʻ𐑃ㄷꮯᑅՙ𝝞ᆡⵏ𝖨Ꮁᛁᑅʻ,ˋߵᒧⲶヿꮁꞋ𐑃ⵏʽꘌⲄᒲⵎᅵ,ᢵ𝖨ߴˈᅠᅵⵏᒧ𝗜𝗅ᢶ𐑃ㆍ𝗖ǁ,ⳐᅠⲄᐳⲓᱻ𝖨ᄂ𐑃Ꞌｰꘌ𐐛𝝞ʽ,ǁᏞˈᇺ𝖫ʽᆫⳟˌꮮᒯߵᢶⲓᑉ,Ⲥⳟｰ𐑋ㄴニ𝝘ᅵꓹᇺʻꓹᒲˍᆨ,டꘌᐩᢵ𝗹ㄧ𐑃ᅠᅟᢵ𝗝ⵏ𝖩ᒧᒥ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ˋᢴᱻꘌᑁㄧˋˉꞋᆨᛌǀㄱᐸ𐐹,ᐨᄀ𝗅ᙿㆎㄧ𐑋ᇺⲥ𝗝𝖫ᢵ𝝞ᅳᑉ,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ𝝞𝖢ᐳ,ⳟㅡᎱⵎᛌᒷᆞᑄ𐐽ᑉ𐐽ᆡᅠᛌㅣ,ᙿ𐐹ˎᐩᒥⲄᑉʻꮮ𝝣ᄀｰᙿⳟᒯ,ⵏᛧⲺꘌˎ𝝞ⲤⳐᐨⲅˋᅟˉᇺᏟ,ᇺᱻⳐᅳᆡꞋㄴǀˍⲷˈ𐐕𝖫Ꮁ𝖩,ᒪᄂ𝝣ˎʹ𝖨ꓹ𝝞ᒣʹⵏᑊ